// src/services/CoordenadasService.js
import axios from 'axios';

const API_URL = 'http://localhost:9001/Laboratorio1'; // Cambia esto a tu URL base

const CoordenadasService = {
  getCoordenadas: async () => {
    try {
      const response = await axios.get(`${API_URL}/coordenadas`); // Endpoint para obtener coordenadas
      return response.data; // Asumiendo que la respuesta es un array de coordenadas
    } catch (error) {
      console.error('Error fetching coordinates:', error);
      throw error;
    }
  },
};

export default CoordenadasService;
